sys_variable_value.value:
(function execute(inputs, outputs) {
  var table = inputs.table;
  var documentId = inputs.document_id;
  var gr = new GlideRecord(table);
  gr.get(documentId);
  outputs.record = gr;
})(inputs, outputs);

